INSERT INTO `jobseeker_registration` (`id`, `jobseeker_registration_name`, `description`, `fr_description`, `priority`, `alert_default`) VALUES
(1, 'jobseeker_registration_template1', '<div style=\"background-color: #edf0f3; font-size: 14px; color: #272727; font-weight: normal; padding: 25px 0;\">\r\n<div style=\"background-color: #fff; border: 1px solid #dadce0; width: 500px; margin: 0 auto; border-radius: 7px; padding: 25px 20px;\">\r\n<div style=\"text-align: center; width: 85px; margin: 0 auto;\">{logo}</div>\r\n<div style=\"background-color: #dadce0; height: 0.5px; margin: 20px 0;\"></div>\r\n<div style=\"margin: 20px 0;\">Dear {jobseeker_name},</div>\r\n<div style=\"margin: 20px 0; color: #636363;\">Thank you for registering on {site_title}</div>\r\n<div style=\"margin: 20px 0; color: #636363;\">\r\n<div style=\"margin: 10px 0; color: #636363;\">Your username: <span style=\"color: #1f4b7c;\">{user_name}</span></div>\r\n<div style=\"margin: 10px 0; color: #636363;\">Your password : <span style=\"color: #1f4b7c;\">{password}</span></div>\r\n</div>\r\n<div style=\"margin: 20px 0; color: #636363;\">You can access our site by this username/password.</div>\r\n<div style=\"margin: 20px 0; color: #636363;\">If you have any query then you can contact with us by clicking on the following link <span style=\"color: #1f4b7c;\">{admin_email}</span></div>\r\n<div style=\"margin: 20px 0; color: #636363;\">Admin<br /> This is an automated response, please do not reply!</div>\r\n</div>\r\n</div>', '<div style=\"background-color: #edf0f3; font-size: 14px; color: #272727; font-weight: normal; padding: 25px 0;\">\r\n<div style=\"background-color: #fff; border: 1px solid #dadce0; width: 500px; margin: 0 auto; border-radius: 7px; padding: 25px 20px;\">\r\n<div style=\"text-align: center; width: 85px; margin: 0 auto;\">{logo}</div>\r\n<div style=\"background-color: #dadce0; height: 0.5px; margin: 20px 0;\"></div>\r\n<div style=\"margin: 20px 0;\">Dear {jobseeker_name},</div>\r\n<div style=\"margin: 20px 0; color: #636363;\">Thank you for registering on {site_title}</div>\r\n<div style=\"margin: 20px 0; color: #636363;\">\r\n