le} - Job Agent. Feel free to update your resume if needed and apply to the opportunities that fit your skills and interests. Turn your passion into a paycheck with jobs that make a difference.</div>\r\n<div style=\"margin: 20px 0; color: #636363;\">Regards,</div>\r\n<div style=\"margin: 20px 0; color: #636363;\">{site_link}</div>\r\n<div style=\"margin: 40px 0 20px 0; color: #636363; font-weight: bold;\">Job Alert Results ({job_alert_values})</div>\r\n<!-- BEGIN job_alert_template -->\r\n<div style=\"margin-bottom: 20px;\">\r\n<div>{job_alert_template.job_title}</div>\r\n<div>{job_alert_template.company}</div>\r\n<div>{job_alert_template.location}</div>\r\n<div>{job_alert_template.apply_now_button}</div>\r\n</div>\r\n<!-- END job_alert_template --></div>\r\n</div>', 0, 'Yes');
