he following are the most recent job matches for you based on your {site_title} - Job Agent. Please update your resume in order to send it to the following company\'s and make it available for company\'s to search!</div>\r\n<div style=\"margin: 20px 0; color: #636363;\">Regards,</div>\r\n<div style=\"margin: 20px 0; color: #636363;\">{site_link}</div>\r\n<div style=\"margin: 40px 0 20px 0; color: #636363; font-weight: bold;\">Job Alert Results ({job_alert_direct_values})</div>\r\n<!-- BEGIN job_alert -->\r\n<div style=\"margin-bottom: 20px;\">\r\n<div>{job_alert.job_title}</div>\r\n<div>{job_alert.company}</div>\r\n<div>{job_alert.location}</div>\r\n<div>{job_alert.apply_now_button}</div>\r\n</div>\r\n<!-- END job_alert --></div>\r\n<div style=\"font-size: 11px; text-align: center; margin-top: 12px;\">You are getting this Email because you Register for it. Click here to {unsubscribe_link}.</div>\r\n</div>', 0, 'Yes');
